"use strict";

exports.$exported = true;

const tracerJs = require('syracuse-core').getTracer("etna.supervisor");

exports.PARVAL = function (_: _,  arcv, paramcod) {
	const paramval = arcv.paramval(_, paramcod);

	tracerJs.debug && tracerJs.debug("PARVAL(" + paramcod + ")=" + paramval);
	return paramval;
};